import React, { useState, useEffect } from 'react';
import firstImage from './s1.png';
import secondImage from './s2.png';

const RotatingImage = () => {
  const [currentShape, setCurrentShape] = useState(0);
  const [animationPhase, setAnimationPhase] = useState('initialRotation');
  const [starState, setStarState] = useState('white');

  const shapes = [
    `M150 20 C220 20 270 70 270 150 C270 230 220 280 150 280 C80 280 30 230 30 150 C30 70 80 20 150 20 Z`,
    "M150 20 C230 20 280 70 280 150 C280 230 230 280 150 280 C70 280 20 230 20 150 C20 70 70 20 150 20 Z",  // Original shape
    // Gemini-inspired shape (adjusted for the context)
    `M0 121.5C0 54.3974 54.3974 0 121.5 0C188.603 0 243 54.3974 243 121.5C243 188.603 188.603 243 121.5 243C54.3974 243 0 188.603 0 121.5Z`, // Gemini button shape
    // Additional complex shape inspired by Gemini animation paths
    `M93.132 11.953C108.636 -3.98432 134.364 -3.98432 149.868 11.953C157.414 19.7095 167.885 24.0325 178.747 23.9027C200.892 23.6379 219.001 41.5209 218.74 63.5022L218.728 64.5295C218.601 75.1557 222.834 85.3762 230.452 92.8429L231.273 93.6477C246.909 108.973 246.909 134.027 231.273 149.352L230.452 150.157C222.834 157.624 218.601 167.844 218.728 178.47L218.74 179.498C219.001 201.479 200.892 219.362 178.747 219.097C167.885 218.967 157.414 223.29 149.868 231.047C134.364 246.984 108.636 246.984 93.132 231.047C85.5863 223.29 75.115 218.967 64.2529 219.097C42.1076 219.362 23.9994 201.479 24.2603 179.498L24.2725 178.471C24.3986 167.844 20.1664 157.624 12.5482 150.157L11.727 149.352C-3.90902 134.027 -3.90901 108.973 11.727 93.6477L12.5482 92.8429C20.1664 85.3761 24.3986 75.1557 24.2725 64.5295L24.2603 63.5022C23.9994 41.5209 42.1076 23.6379 64.2529 23.9027C75.115 24.0325 85.5863 19.7095 93.132 11.953Z`
  ];

  useEffect(() => {
    let timeoutId;
    const startNewCycle = () => {
      setAnimationPhase('initialRotation');
      setStarState('white');

      timeoutId = setTimeout(() => {
        setStarState('collapsing');
        setAnimationPhase('collapsing');

        timeoutId = setTimeout(() => {
          setStarState('black');
          setAnimationPhase('emerging');

          timeoutId = setTimeout(() => {
            setStarState('rotating');

            timeoutId = setTimeout(startNewCycle, 1000);
          }, 2000); 
        }, 2000); 
      }, 10000); 
    };

    startNewCycle();
    return () => {
      if (timeoutId) clearTimeout(timeoutId);
    };
  }, []);

  useEffect(() => {
    let interval;
    if (animationPhase === 'initialRotation') {
      interval = setInterval(() => {
        setCurrentShape((prev) => (prev + 1) % shapes.length);
      }, 2000);
    }
    return () => {
      if (interval) clearInterval(interval);
    };
  }, [animationPhase, shapes.length]);

  const getShapeClassName = () => {
    switch (animationPhase) {
      case 'initialRotation':
        return 'shape-rotating';
      case 'collapsing':
        return 'shape-collapsing';
      case 'emerging':
        return 'shape-hidden';
      default:
        return '';
    }
  };

  return (
    <div style={{ position: "relative", width: "400px", height: "400px" }}>
      <svg
        width="400"
        height="400"
        viewBox="0 0 300 300"
        xmlns="http://www.w3.org/2000/svg"
        className={getShapeClassName()}
        style={{
          position: "absolute",
          top: 0,
          left: 0,
        }}
      >
        <defs>
          <linearGradient id="morphGradient" x1="0" y1="0" x2="1" y2="1">
            <stop offset="0%" stopColor="#00688B" className="gradient-start" />
            <stop offset="100%" stopColor="#8A2BE2" className="gradient-end" />
          </linearGradient>
          <radialGradient id="shineGradient">
            <stop offset="0%" stopColor="rgba(141, 88, 245, 0)" />
            <stop offset="50%" stopColor="rgba(116, 56, 236, 0)" className="shine-mid" />
            <stop offset="100%" stopColor="rgba(147, 112, 219, 0)" />
          </radialGradient>
        </defs>
        <g>
          <path
            d={shapes[currentShape]}
            fill="url(#morphGradient)"
            style={{
              transition: "d 1.5s ease-in-out",
            }}
          />
          <path
            d={shapes[currentShape]}
            fill="url(#shineGradient)"
            className="shine-overlay"
            style={{
              transition: "d 1.5s ease-in-out",
              mixBlendMode: "soft-light",
            }}
          />
        </g>
      </svg>

      <div
        style={{
          position: "absolute",
          top: "50%",
          left: "50%",
          transform: "translate(-50%, -50%)",
          width: "200px",
          height: "200px",
          zIndex: 1
        }}
      >
        <div className="star-container">
          <img
            src={firstImage}
            alt="White star"
            className="star white-star"
            style={{
              width: "100%",
              height: "100%",
              objectFit: "cover",
              display: ['white', 'collapsing'].includes(starState) ? 'block' : 'none',
              animation: starState === 'collapsing' ? 'rotateAndCollapse 2s forwards' : 'none'
            }}
          />
          <img
            src={secondImage}
            alt="Black star"
            className="star black-star"
            style={{
              width: "100%",
              height: "100%",
              objectFit: "cover",
              display: ['black', 'paused'].includes(starState) ? 'block' : 'none',
              animation: starState === 'black' ? 'emergeAndRotate 2s forwards' :'emergeAndRotate 2s forwards'
            }}
          />
        </div>
      </div>

      <style>
        {`
          .shape-rotating {
            animation: rotateBackground 5s linear infinite;
          }

          .shape-collapsing {
            animation: collapseShape 2s forwards;
          }

          .shape-hidden {
            opacity: 0;
            transform: scale(0.01);
          }

          .star-container {
            position: relative;
            width: 100%;
            height: 100%;
          }

          .star {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
          }

          @keyframes collapseShape {
            0% { transform: scale(1); }
            100% { transform: scale(0.05); opacity: 0; }
          }

          @keyframes rotateBackground {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
          }

          @keyframes emergeAndRotate {
            0% { opacity: 0; transform: rotate(0deg); }
            100% { opacity: 1; transform: rotate(360deg); }
          }
        `}
      </style>
    </div>
  );
};

export default RotatingImage;
